# DeathMessages by Dreeam__ (Original by MrShawn/Joshb_/CosmoConsole[DeathMessagesPrime Author])
#
Prefix: '&b&lSKYBLOCK &8&l┃ &7'
Console:
  # Send death messages to console
  Enabled: true
  Message: '%message% (Extra: World:%world%, X:%x%, Y:%y%)'
Bungee:
  # Configure how bungee messages look from other servers.
  # Only available placeholder is %server_name%
  # Configure how bungee messages look from other servers.
  # Only available placeholder is %server_name%
  Message: '&b&l%server_name% &8&l┃ &7'
Commands:
  DeathMessages:
    Player-Only-Command: '%%prefix%Only players can run this command.'
    No-Permission: '%prefix%You don''t have a permission to do that!'
    Help:
    - '&3&m         &b&m          &b&l[ &fDeath &8| &bHelp &b&m          &3&m          &r'
    - ''
    - '&b/deathmessages blacklist &3<username> &8-&7 blacklists the user from death
      messages. They will still see other player''s death messages, but not send them.'
    - '&b/deathmessages toggle &8-&7 Toggle death messages on or off.'
    - '&b/deathmessages reload &8-&7 Reload plugin configs.'
    - '&b/deathmessages edit &3<player> <mobName> <solo, gang> <damage-type> <add,
      remove, list> &8(remove only=Placeholder) &8-&7 Edits the death messages.'
    - ''
    - '&3&m         &b&m          &b&l[ &fDeath &8| &bHelp &b&m          &3&m          &r'
    Sub-Commands:
      Reload:
        Reloaded: '%prefix%Reloaded all plugin configs.'
      Toggle:
        Toggle-On: '%prefix%You have toggled your death messages to &aEnabled&7! &8&o(/toggle)'
        Toggle-Off: '%prefix%You have toggled your death messages to &cDisabled&7!
          &8&o(/toggle)'
      Blacklist:
        Help: '&c&l| &cWrong Usage! &b/dm blacklist &3<username> &8-&7 blacklists
          the user from death messages. They will still see death messages, but not
          send them.'
        Username-None-Existent: '%prefix%Could not find the player with the username
          &f%player%'
        Blacklist-Add: '%prefix%Blacklisted &f%player%&7!'
        Blacklist-Remove: '%prefix%Removed &f%player% &7from being blacklisted.'
      Version: '%prefix%Running DeathMessages &f%version%&7 by Joshb_'
      Edit:
        Usage: '&c&l| &cWrong Usage! &b/dm edit&3 <player> <mobName> <solo, gang>
          <damage-type> <add, remove, list>&8 (remove only=Placeholder) &8-&7 Edits
          the death messages.'
        Invalid-Mob-Type: '%prefix%The mob name you specified does not exist.'
        Invalid-Damage-Type: '%prefix%The damage type you specified does not exist.
          Try using tab complete to select one.'
        Invalid-Arguments: '%prefix%Invalid arguments. Use &f/dm edit &7to view them.'
        Invalid-Placeholder: '%prefix%The placeholder must be numeric.'
        Removed-Message: '%prefix%Removed ''&f%message%&&'''
        Invalid-Selection: '%prefix%The message with that placeholder does not exist.'
        Adding-Start: '%prefix%You are in add message mode. Start typing in chat to
          add a new message.'
        Added-Message: '%prefix%Added &7''&f%message%&7'' to &f%mob_name% &8>&7 %mode%
          &8>&7 %damage_type%'
      Backup:
        Usage: '&c&l| &cWrong Usage! &b/dm backup &3<true, false> &8-&7 Backup plugin
          files. True will not save user-data, false will save user-data.'
        Backed-Up: '%prefix%Backup &f#%backup-code% &7has been saved.'
      Restore:
        Usage: '&c&l| &cWrong Usage! &b/dm restore &3<backup-code> <true, false> &8-&7
          True will not restore user-data, false will restore user-data.'
        Restored: '%prefix%Plugin files restored from backup &e#%backup-code%'
        Backup-Not-Found: '%prefix%The backup with that code does not exist.'
